import React from 'react';
import './TrailersLanding.css';
// import Navigation from './Navigation/Navigations';


function Landing(props){

    return(
        <div className='header-one'>
        <div className="navigation">
        <div className="menu">
        <ul>
        <li><a href="/" className="fa fa-eye"></a></li>
            <li><a href="/" className="menu-item">Movies</a></li>
            <li><a href="/" className="menu-item">TV Series</a></li>
            <li><a href="/" className="menu-item">People</a></li>
            <li><a href="/" className="menu-item">Collections</a></li>
            <li><a href="/" className="menu-item">Trending</a></li>
            <li><a href="/" className="fa fa-search"></a></li>


        </ul>
        </div>
        </div>
        <div className="header">
        <h1>{props.name}</h1>
        
      <h3>{props.title}</h3>
      <div className="a-group">
      <a href ="/" onClick={props.genre}>Watch Now</a>
      </div>
      
      
       
       
        
        </div>
    
        </div>
        
    )
};

export default Landing;
